Creating a full-stack web application using React, Node.js, and Express.js involves several steps. Below is a step-by-step guide to help you create a simple application that allows you to add and display dummy data. Additionally, I'll provide instructions on how to deploy the application.

### Step 1: Set Up the Project

1. **Initialize the Project**

   Create a new directory for your project and initialize it with npm:

   ```bash
   mkdir my-fullstack-app
   cd my-fullstack-app
   npm init -y
   ```

2. **Set Up the Backend (Node.js and Express.js)**

   Create a new directory for the backend:

   ```bash
   mkdir backend
   cd backend
   npm init -y
   npm install express body-parser cors
   ```

   Create a file named `server.js` in the `backend` directory:

   ```javascript
   // backend/server.js
   const express = require('express');
   const bodyParser = require('body-parser');
   const cors = require('cors');

   const app = express();
   const PORT = 5000;

   app.use(cors());
   app.use(bodyParser.json());

   let dummyData = [];

   app.get('/api/data', (req, res) => {
     res.json(dummyData);
   });

   app.post('/api/data', (req, res) => {
     const newData = req.body;
     dummyData.push(newData);
     res.json(dummyData);
   });

   app.listen(PORT, () => {
     console.log(`Server is running on port ${PORT}`);
   });
   ```

3. **Set Up the Frontend (React)**

   Navigate back to the root directory and create a new React app:

   ```bash
   cd ..
   npx create-react-app frontend
   cd frontend
   npm install axios
   ```

   Create a new file named `App.js` in the `src` directory of the `frontend` folder:

   ```javascript
   // frontend/src/App.js
   import React, { useState, useEffect } from 'react';
   import axios from 'axios';

   function App() {
     const [data, setData] = useState([]);
     const [newData, setNewData] = useState('');

     useEffect(() => {
       axios.get('http://localhost:5000/api/data')
         .then(response => setData(response.data))
         .catch(error => console.error('Error fetching data:', error));
     }, []);

     const addData = () => {
       axios.post('http://localhost:5000/api/data', { text: newData })
         .then(response => setData(response.data))
         .catch(error => console.error('Error adding data:', error));
     };

     return (
       <div>
         <h1>Dummy Data App</h1>
         <input
           type="text"
           value={newData}
           onChange={(e) => setNewData(e.target.value)}
         />
         <button onClick={addData}>Add Data</button>
         <ul>
           {data.map((item, index) => (
             <li key={index}>{item.text}</li>
           ))}
         </ul>
       </div>
     );
   }

   export default App;
   ```

### Step 2: Run the Application

1. **Start the Backend Server**

   ```bash
   cd backend
   node server.js
   ```

