To ensure that the code inside the `useEffect` hook runs only once every 0.6 seconds, you can use a combination of `useRef` and `setTimeout` to create a debounce mechanism. Here's how you can modify your code:

```javascript
import { useEffect, useRef } from 'react';

const YourComponent = ({ cursor, tl, $portfolioNext, $portfolioCurrent }) => {
  const debounceRef = useRef(null);

  useEffect(() => {
    if (debounceRef.current) {
      clearTimeout(debounceRef.current);
    }

    debounceRef.current = setTimeout(() => {
      tl.set($portfolioNext.current, {
        clipPath: 'polygon(20% 50%, 80% 50%, 80% 50%, 20% 50%)',
      });
      tl.set($portfolioNext.current, {
        css: { backgroundImage: 'url(' + cursor.cursorImage + ')' },
      });

      tl.to($portfolioCurrent.current, {
        clipPath: 'polygon(20% 50%, 80% 50%, 80% 50%, 20% 50%)',
        duration: 0.5,
      }, 'start');

      tl.to($portfolioNext.current, {
        clipPath: 'polygon(0% 0%, 100% 0%, 100% 100%, 0% 100%)',
        delay: 0.1,
        duration: 0.5,
      }, 'start');

      tl.set($portfolioCurrent.current, {
        clipPath: 'polygon(0% 0%, 100% 0%, 100% 100%, 0% 100%)',
      });

      tl.set($portfolioCurrent.current, {
        css: { backgroundImage: 'url(' + cursor.cursorImage + ')' },
      });
    }, 600);

    return () => {
      if (debounceRef.current) {
        clearTimeout(debounceRef.current);
      }
    };
  }, [cursor.cursorImage]);

  return (
    // Your component JSX
  );
};

export default YourComponent;
```

### Explanation:
1. **useRef**: We use `useRef` to store the timeout ID. This allows us to clear the timeout if the effect runs again before the timeout completes.
2. **setTimeout**: We wrap the code inside a `setTimeout` with a delay of 600 milliseconds (0.6 seconds).
3. **clearTimeout**: Before setting a new timeout, we clear any existing timeout to ensure that the code doesn't run more frequently than intended.
4. **Cleanup Function**: The cleanup function in the `useEffect` hook ensures that the timeout is cleared when the component unmounts or when the dependencies change.

This approach ensures that the code inside the `useEffect` hook runs only once every 0.6 seconds, even if the `cursor.cursorImage` changes more frequently.

